Cleaner (2007)  

Verenigde Staten
Thriller
93 minuten

geregisseerd door Renny Harlin
met Samuel L. Jackson, Ed Harris en Eva Mendes

Tom is een voormalige politie-agent met een lichte neurose richting angst voor onhygiene, die deze eigenschap ook in zijn werk meeneemt: namelijk het schoonmaken van plaats delicten. Hij raakt tijdens een zaak betrokken bij een uitvoerig web van intriges wanneer blijkt dat een moord in de doofpot is gestopt.



